  inSysData->isPatternAvailable = 'T';
  inSysData->sparsePattern = (SPARSE_PATTERN*) malloc(sizeof(SPARSE_PATTERN));
  inSysData->sparsePattern->leadindex = (unsigned int*) malloc((6+1)*sizeof(int));
  inSysData->sparsePattern->index = (unsigned int*) malloc(20*sizeof(int));
  inSysData->sparsePattern->numberOfNoneZeros = 20;
  inSysData->sparsePattern->colorCols = (unsigned int*) malloc(6*sizeof(int));
  inSysData->sparsePattern->maxColors = 4;
  
  /* write lead index of compressed sparse column */
  memcpy(inSysData->sparsePattern->leadindex, colPtrIndex, (6+1)*sizeof(int));
  
  for(i=2;i<6+1;++i)
    inSysData->sparsePattern->leadindex[i] += inSysData->sparsePattern->leadindex[i-1];
  
  /* call sparse index */
  memcpy(inSysData->sparsePattern->index, rowIndex, 20*sizeof(int));
  
